(39, 1, 0, 'Kreycik Riverview Elk Ranch', '88971 517 Ave', NULL, 383, 32, '68760', '88971 517 Ave', 0, 0, NULL, 'Tours mid-May thru Sep, Sat, 10am & 2pm; Sun, 2pm; or by appt. Large groups by appt. any day of the week. No tours conducted on Memorial Day, 4th of July, or Labor Day.', 'A working ranch with a covered wagon ride through bison, elk and fallow deer herds. Opportunities to hand-feed bison. We have 2 wagons, each holds 32 passengers.', NULL, '2 hours', '2 1/2 hours', 1, 1, 0, 1, NULL, 1, 1, 0, 0, 1, 0, 0, NULL, '10', '64', 0, 0, '2010-06-08 00:00:00', 1, 0, 0, 'kreycikelkranch@yahoo.com', 'www.nebraskaelktours.com', 1, 0, NULL, 1, 1, 1, 1, 1, 0, 1, 0, 0, 1, 'Gift shop on site.', 1, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL);
