(582, 2, 0, 0, 73, 'Boys Town', '137th & W. Dodge Rd, 2 1/2 mi. W. of I-680 - Established in 1917 by Father Edward J. Flanagan, Boys Town is a national organization saving children and healing families across America. The village was made famous by the 1938 award-winning movie "Boys Town," staring Spencer Tracy and Mickey Rooney. The Hall of History features Tracy''s Academy Award and presents an exciting review of Boys Town''s founding and impact on the lives of children. The Father Flanagan House Museum is the renovated home of Boys Town''s founder and features a glimpse at early life at Boys Town. Other attractions on the 900-acre site include Father Flanagan''s Tomb, Dowd Memorial Chapel, Chambers Chapel, Garden of the Bible, the "Two Brothers" statue and the Leon Myers Stamp Center that houses the "World''s Largest Ball of Stamps." Located inside the Visitors Center is the gift shop and Boys Town Caf. Self-guided audio tours are available in several languages for a suggested donation of $5. Large group guided tours by appt. only. Open year-round, Mon-Fri, 8am-5pm; Sat, 9am-4pm; Sun, 11am-4pm. Hall of History open May-Aug, Mon-Sat, 9am-5pm; Sun, 11am-4pm. Open Mon-Sat, 10am-4pm; Sun, 11am-4pm the rest of the year. Closed Easter, Thanksgiving, Christmas & New Year''s Day. Free. 402-498-1141 or 888-556-5121', 'boystown.org/Discover', 1, '13628 Flanagan Blvd', NULL, 0, 1, 'discover@boystown.org', '13628 Flanagan Blvd', 'PO Box 1', 32, '68010', '2002-10-09 00:00:00', '2012-08-06 00:00:00', NULL, NULL, NULL, NULL, 0, 1, NULL, NULL, NULL, '137th & W. Dodge Rd - The Village of Boys Town is a National Historic Landmark founded by Father Flanagan and made famous by the Academy Award-winning movie "Boys Town." Hall of History, Father Flanagan House, gardens, chapels and visitor center. Open year-round, Mon-Fri, 8am-5pm; Sat, 9am-4pm; Sun, 11am-4pm. Closed Easter, Thanksgiving, Christmas & New Year''s Day. Free. 888-556-5121 or 402-498-1141 www.boystown.org/Discover', 0, 1