INSERT INTO `region` (`RegionID`, `RegionName`, `Map`, `Description`, `Image`, `Title`, `EventsCount`, `LastImport`, `LastExport`, `SortOrder`) VALUES (1, 'Pioneer', 'map-pioneer.gif', 'From original homestead cabins to the\r\n      architectural wonders of the State Capitol, the\r\n      Land of the Pioneers is a rich and exciting land\r\n      to explore. Historic attractions and events in\r\n      the river towns of the east complement the\r\n      prairie experience, ethnic cultures, and modern\r\n      highlights found in towns and cities to the west.\r\n      If variety is the spice of your life, you''ll love\r\n      touring this area.', 'hunter.jpg', 'Nebraska''s Land of the\r\n      Prairie Pioneer', 60, '2012-09-05 00:00:00', '2012-09-05 00:00:00', 5),
(2, 'Lewis and Clark', 'map-lewisclark.gif', 'The mighty Missouri River defines the northern\r\n      and eastern borders of this region first explored\r\n      by Lewis and Clark in 1804. It was the winding\r\n      road navigated by trappers, traders and Native\r\n      American Indians. For centuries, it has fed and\r\n      shaped the personality of this fertile land. Poet\r\n      John Neihardt was greatly moved by the river\r\n      and the spiritual heritage of the Native\r\n      Americans of the region. His work chronicles\r\n      and preserves the richness of the Sioux and\r\n      Omaha Indian cultures. It''s a land of beauty\r\n      and wonder that is sure to bring out the\r\n      explorer in anyone.', 'canoe-missouri.jpg', 'Nebraska''s Land of Lewis\r\n      & Clark', 60, '2012-09-05 00:00:00', '2012-09-05 00:00:00', 7),
(3, 'Metro', NULL, NULL, NULL, NULL, 120, '2012-09-05 00:00:00', '2012-09-05 00:00:00', 6),
(4, 'Panhandle', NULL, NULL, NULL, NULL, 60, '2012-09-05 00:00:00', '2012-09-05 00:00:00', 1),
(5, 'Prairie Lakes', 'map-plakes.gif', 'In 1820, Stephen Long, explorer and military man,\r\n      called this country the Great American Desert.\r\n      Today, he''d be shocked to discover dozens of\r\n      man-made lakes and huge reservoirs\r\n      complementing the grassy plains of the region. \r\n\r\n      Nowhere is the relationship of man and the land\r\n      more poignantly realized than Nebraska''s Prairie\r\n      Lakes Country. This relationship becomes even\r\n      more evident in the excellent museums, historic\r\n      homes and memorable personalities of the area\r\n      such as Willa Cather and Senator George Norris. It''s\r\n      a country rich in history and personality that you''ll\r\n      enjoy getting to know and returning to year after year.', 'plake.jpg', 'Nebraska''s Prairie Lakes\r\n      Country', 60, '2012-09-05 00:00:00', '2012-09-05 00:00:00', 2),
(6, 'Sandhills', 'map-sand.gif', 'Gentle rivers meander along pine-studded canyons,\r\n      towering waterfalls and a veritable ocean of prairie\r\n      grasses alongside America''s largest man-made\r\n      forest, a wildlife refuge of gigantic proportions and\r\n      cattle ranches that are better comprehended from\r\n      the air than the ground. It''s a wide-open landscape.\r\n      A landscape that inspired Mari Sandoz to produce\r\n      some of this country''s finest fiction. A landscape\r\n      you''ll enjoy exploring by car or canoe.', 'cherry-road.jpg', 'Nebraska''s Sandhills Country', 60, '2012-09-05 00:00:00', '2012-09-05 00:00:00', 3),
(7, 'Frontier Trails', NULL, NULL, NULL, NULL, 60, '2012-09-05 00:00:00', '2012-09-05 00:00:00', 4),
(8, 'unassigned', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
